eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   alanQuotes: () => (/* binding */ alanQuotes)\n/* harmony export */ });\nconst alanQuotes = [\n    {\n        text: \"This is the real secret of life–to be completely engaged with what you are doing in the here and now. And instead of calling it work, realize it is play.\",\n        citation: \"The Essence of Alan Watts\",\n        prompt: \"\"\n    },\n    {\n        text: \"The actual trouble is that profit is identified entirely with money, as distinct from the real profit of living with dignity and elegance in beautiful surroundings.\",\n        citation: \"Does it Matter\",\n        prompt: \"\"\n    },\n    {\n        text: \"For eternally and always there is only now, one and the same now; the present is the only thing that has no end.\",\n        citation: \"The Book on the Taboo Against Knowing Who You Are\",\n        prompt: \"\"\n    },\n    {\n        text: \"People who exude love are apt to give things away. They are in every way like rivers; they stream. And so when they collect possessions and things they like, they are apt to give them to other people. Because, have you ever noticed that when you start giving things away, you keep getting more?\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"We love to see a child lost in the dance and not performing for the audience. To be happy and know that you are happy is really the overflowing cup of life. To dance as if there is no audience.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"Only those who have cultivated the art of living completely in the present have any use for making plans for the future, for when the plans mature, they will be able to enjoy the results.\",\n        citation: \"The Joyous Cosmology\",\n        prompt: \"\"\n    },\n    {\n        text: \"Your soul is not in your body. Your body is in your soul.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"A buddha would see you all as exactly right; just where you are, all of you are buddhas. Even for those of you who do not know it, it is right for you not to know at the moment.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"Reality itself is gorgeous. It is the plenum; the fullness of total joy.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you know that this moment is the Tao, and this moment is considered by itself without past and without future–eternal, neither coming into being nor going out of being–there is Nirvana.\",\n        citation: \"The Philosophies of Asia\",\n        prompt: \"\"\n    },\n    {\n        text: \"Because we cannot relate to the sensuous and material present, we are most happy when good things are expected to happen, not when they are happening.\",\n        citation: \"Does it Matter\",\n        prompt: \"\"\n    },\n    {\n        text: \"There are, then, two ways of understanding an experience. The first is to compare it with the memories of other experiences, and so to name it and define it. This is to interpret it in accordance with the dead and the past. The second is to be aware of it as it is, as when, in the intensity of joy, we forget past and future, let the present be all, and then do not even stop to think ‘I am happy’.\",\n        citation: \"The Wisdom of Insecurity\",\n        prompt: \"\"\n    },\n    {\n        text: \"The hills are moving into their stillness. They mean something because they are being transformed into my brain, and my brain is an organ of meaning.\",\n        citation: \"The Joyous Cosmology\",\n        prompt: \"\"\n    },\n    {\n        text: \"Not picking and choosing does not mean that you have to cultivate being detached. You can try that, sure. But then you find you’re terribly attached to your non-attachment. Like you’re proud of your humility.\",\n        citation: \"Zen and the West (audio)\",\n        prompt: \"\"\n    },\n    {\n        text: \"For when we stand with our nature, seeing that there is nowhere to stand against it, we are at last able to move unmoved.\",\n        citation: \"Nature, Man and Woman\",\n        prompt: \"\"\n    },\n    {\n        text: \"Money is an abstraction. It cannot, of itself, buy any pleasure whatsoever. Because all pleasures involve skill and love.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"In the beginning stage, you don’t know what you want because you haven’t thought about it, or you’ve only thought superficially. Then, when somebody forces you to think about it… ‘Yeah, I think I’d like this; I think I’d like that; I think I’d like the other. ’ There’s the middle stage. Then you get beyond that and say, ‘Is that what I really want?’ And at the end, you say, ‘No, I don’t think that’s it.’ I might be satisfied with it for a while, and I wouldn’t turn my nose up at it. But it's not really what I want.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"Why don’t you really know what you want? Two reasons that you don’t really know what you want. Number one: you have it. Number two: you don’t know yourself, because you never can. The godhead is never an object of its own knowledge. Just as a knife doesn’t cut itself, fire doesn’t burn itself, life doesn’t illumine itself. It’s always an endless mystery to itself. ‘I don’t know.’... This ‘I don’t know’ is the same thing as ‘I love’, ‘I let go’, ‘I don’t try to force or control’. It's the same thing as humility.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"Light is a relationship between electrical energy and eyeballs. It is you, in other words, who evoke the world, and you evoke the world in accordance with what kind of a ‘you’ you are.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"Thoughts, ideas, and words are ‘coins’ for real things. They are not those things, and though they represent them, there are many ways in which they do not correspond at all. As with money and wealth, so with thoughts and things; ideas and words are more or less fixed, whereas real things change.\",\n        citation: \"The Wisdom of Insecurity\",\n        prompt: \"\"\n    },\n    {\n        text: \"The more complete kind of mind, which can feel as well as think, remains to ‘indulge’ the odd sense of mystery which comes from contemplating the fact that everything is at base something which cannot be known.\",\n        citation: \"Become What You Are\",\n        prompt: \"\"\n    },\n    {\n        text: \"Transiency is a mark of spirituality. A lot of people think the opposite… that the spiritual things are the everlasting things. But you see, the more a thing tends to be permanent, the more it tends to be lifeless.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"We’re running into a cultural situation where we’ve confused the symbol with the physical reality; the money with the wealth; and the menu with the dinner. And we’re starving on eating menus.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"The ego is a kind of flip, a knowing of knowing, a fearing of fearing. It's a curlicue, an extra jazz to experience, a sort of double-take or reverberation, a dithering of consciousness which is the same as anxiety.\",\n        citation: \"The Joyous Cosmology\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you look out of your eyes, at nature happening out there, you’re looking at you. That’s the real you. The you that goes on of itself.\",\n        citation: \"A Conversation With Myself - Part 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"What you are in your in-most being escapes your examination in rather the same way that you can’t look directly into your own eyes without using a mirror, you can’t bite your own teeth, you can’t taste your own tongue, and you can’t touch the tip of this finger with the tip of this finger.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"Faith is, above all, an open-ness–an act of trust in the unknown.\",\n        citation: \"The Book on the Taboo Against Knowing Who You Are\",\n        prompt: \"\"\n    },\n    {\n        text: \"The word ‘person’ comes from the latin word ‘persona’ which referred to the masks worn by actors in which sound would come through. The ‘person’ is the mask—the role you’re playing. And all of your friends and relations and teachers are busy telling you who you are and what your role in life is.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"There’s no need to possess [the Tao]. You are it, and by trying to possess it you imply that you’re not. So, by trying to catch hold of it, you as it were, push it away… Although you can’t really push it away because the very pushing is all it. You see?\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"If you say making money is the most important thing, you will spend your life completely wasting your time. You’ll be doing things you don’t like doing in order to go on living. That is, to go on doing things you  don’t like doing, which is stupid. Better to have a short life, which is full of things you like doing, than a long one spent in a miserable way.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"This very moment, this very world, this very body is the point. Now. You see? But if you’re seeking something beyond all the time, you never get with it. You’re never here.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"Suppose you knew the future and could control it perfectly, what would you do? You’d say: ‘Let’s shuffle the deck and have another deal.’\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"I see that resistance, ego, is just an extra vortex in the stream—part of it—and that in fact there is no actual resistance at all. There is no point from which to confront life, or stand against it.\",\n        citation: \"The Joyous Cosmology\",\n        prompt: \"\"\n    },\n    {\n        text: \"The physical universe is basically playful. There’s no necessity for it whatsoever. It isn’t going anywhere; that is to say, it doesn’t have a destination that it ought to arrive at. But it is best understood by analogy to music, because music as an art form is essentially playful.\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you are not getting in the way of yourself, you will begin to find out that all the great things you do are really happenings. All growth is something that happens. For growth to happen two things are important. You must have the technical ability to express what happens. And secondly, you must get out of your own way.\",\n        citation: \"\",\n        prompt: \"\"\n    },\n    {\n        text: \"The more it sides with itself, the more the good soul reveals its inseparable shadow, and the more it disowns its shadow the more it becomes it.\",\n        citation: \"The Book on the Taboo Against Knowing Who You Are\",\n        prompt: \"\"\n    },\n    {\n        text: \"The extraordinary capacity to feel an event inwardly, as distinct from bursting into precipitate action to avoid the tension of feeling—this capacity is in fact a wonderful power of adaptation to life, not unlike the instant responses of flowing water to the contours of the ground over which it flows.\",\n        citation: \"Become What You Are\",\n        prompt: \"\"\n    },\n    {\n        text: \"You are all Vishnu playing that you’re in this mess, which is part of the cosmic dance. So, if that’s the case, dig it! You see? I mean, get with it! Be that!\",\n        citation: \"Audio Lecture\",\n        prompt: \"\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./lib/alan-quotes.ts\n");

